steps = ''


map = []

with open('P7-input.txt') as f:
    for line in f:
        map.append(line.split())

x, y = 15, 15

o = ''

print(map[1][2])

for s in steps:
    if s == 'L':
        x -= 1
    if s == 'R':
        x += 1
    if s == 'U':
        y -= 1
    if s == 'D':
        y += 1
    if s == 'X':
        o += map[y][x]

print(o)